import React from 'react';
import '../StyleSheets/NewExpense.css';
import Gennie from '../ExternalFiles/submit.gif'


function SubmitExpenses({}) {
    return (
        
        <div className="submit-container">
           

            <img  src={Gennie}/>
            <h1>Submitted</h1>
            
        </div>
    );
}

export default SubmitExpenses;
